import logo from './logo.svg';
import {Link} from "react-router-dom";
import './App.css';

function App() {
  return (
    <div>
    <h1>Bookkeeper!</h1>
    <Link to="/home">Home</Link>
    <Link to="/careers">Careers</Link>
    </div>
  );
}

export default App;
